import React, { Fragment } from "react";
import { useAuth0 } from "@auth0/auth0-react";
import { Image, Row } from 'react-bootstrap'

const Profile = () => {
    const { user, isAuthenticated } = useAuth0();
    return (
        isAuthenticated && (
            <div>
                <Fragment>
                    <Row>
                        <Col>
                        <Image src={user.picture} alt={user.name} style={{ width: '40px' }} />
                        </Col>
                        <p style={{ fontSize: '18px', fontStyle: 'italic', justifyContent: 'center', fontWeight: 'bold' }}>{user.name}</p>
                        <p style={{ fontSize: '12px', fontStyle: 'italic', justifyContent: 'center' }}>{user.email}</p>
                    </Row>
                </Fragment>
            </div>
        )
    )
}

export default Profile;
